// File contracts/PhantomNFT.sol


pragma solidity ^0.8.0;
contract CDNFT is AccessControlEnumerable, ERC721, ERC721URIStorage, ERC721Burnable, ERC721Enumerable, CRC721Enumerable {
    // ---------- roles ----------
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant WHITELISTER_ROLE = keccak256("WHITELISTER_ROLE");


    // ---------- state variable ----------
    string private _baseUri;


    // ---------- public interface ----------
    constructor(string memory name, string memory symbol, string memory baseUri) ERC721(name, symbol) {
        _baseUri = baseUri;

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(MINTER_ROLE, msg.sender);
        _setupRole(WHITELISTER_ROLE, msg.sender);
    }

    function setBaseURI(string memory baseUri) public onlyRole(DEFAULT_ADMIN_ROLE) {
        _baseUri = baseUri;
    }

    function mint(address owner, uint256 tokenId, string memory tokenUri) public onlyRole(MINTER_ROLE) {
        _mint(owner, tokenId);
        _setTokenURI(tokenId, tokenUri);
    }

    function mintBatch(address[] calldata owners, uint256[] calldata tokenIds, string[] calldata tokenUris) public onlyRole(MINTER_ROLE) {
        require(owners.length == tokenIds.length, "CDNFT: length mismatch");
        require(owners.length == tokenUris.length, "CDNFT: length mismatch");

        for (uint256 ii = 0; ii < owners.length; ++ii) {
            mint(owners[ii], tokenIds[ii], tokenUris[ii]);
        }
    }

    // ---------- compatibility interface ----------

    function tokensOfOwner(address owner)
        public
        view
        returns (uint256[] memory result)
    {
        return tokensOfOwnerByRange(owner, 0, type(uint256).max);
    }

    function tokensOfOwnerByRange(address owner, uint256 fromIndex, uint256 count)
        public
        view
        returns (uint256[] memory result)
    {
        (/* uint256 total */ , uint256[] memory tokenIds) = tokensOf(owner, fromIndex, count);
        return tokenIds;
    }


    // ---------- sponsorship interface ----------

    function enableSponsorshipForAddress(address addr) external onlyRole(WHITELISTER_ROLE) {
        ISponsorWhitelistControl swc = ISponsorWhitelistControl(0x0888000000000000000000000000000000000001);
        address[] memory a = new address[](1);
        a[0] = address(addr);
        swc.addPrivilege(a);
    }

    function disableSponsorshipForAddress(address addr) external onlyRole(WHITELISTER_ROLE) {
        ISponsorWhitelistControl swc = ISponsorWhitelistControl(0x0888000000000000000000000000000000000001);
        address[] memory a = new address[](1);
        a[0] = address(addr);
        swc.removePrivilege(a);
    }


    // ---------- inherited interface ----------

    function _baseURI() internal view override returns (string memory) {
        return _baseUri;
    }

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        virtual
        override(ERC721, ERC721Enumerable)
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721Enumerable, AccessControlEnumerable)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}

